import { useState, useEffect} from "react";
import StarService from "../services/star.service";

function StarList() {
  const [stars, setStars] = useState([]);

  const getAllStars = () => {
    StarService.getAllStars()
      .then((items) => {
        let allStars = [];
        items.forEach(item => {
          const key = item.key;
          const data = item.val();
          allStars.push({
            key: key,
            galaxy : data.galaxy
          });
        });
        setStars([...allStars]);
      })
     
  }


  useEffect(() => {
    getAllStars();
  }, []);

  return (
    <>
    

        <div className="bicycle-list">
          {stars.map(s =>
            <div className="star-item" key={s.key}>
              <p>{s.galaxy}</p>
              
            </div>
          )}
        </div>
     
    </>
  );
}

export default StarList;
